function PopulateEventSearch() {

    for (x in EventTypes) {

        var EventTypeTitle = document.createElement('p');
        var EventTypeDescription = document.createElement('p');

        EventTypeTitle.innerHTML = EventTypes[x].Name;
        EventTypeDescription.innerHTML = EventTypes[x].Description;

        var SECol = document.createElement('div');
        SECol.className = "SECol";
        SECol.id = "SECol" + EventTypes[x].Name;

        var SEContainer = document.createElement('div');
        SEContainer.className = "SEContainer";
        SEContainer.id = "SEContainer" + EventTypes[x].Name;

        var SEFront = document.createElement('div');
        SEFront.className = "SEFront";
        SEFront.id = "SEFront" + EventTypes[x].Name;
        SEFront.style.backgroundImage = "url("+EventTypes[x].Picture+")";

        var SEInner = document.createElement('div');
        SEInner.className = "SEInner";
        SEInner.id = "SEInner" + EventTypes[x].Name;

        var SEInner2 = document.createElement('div');
        SEInner2.className = "SEInner";
        SEInner2.id = "SEInner2" + EventTypes[x].Name;

        var SEBack = document.createElement('div');
        SEBack.className = "SEBack";
        SEBack.id = "SEBack" + EventTypes[x].Name;

        document.getElementById('SECols').appendChild(SECol);
        document.getElementById('SECol' + EventTypes[x].Name).appendChild(SEContainer);
        document.getElementById('SEContainer' + EventTypes[x].Name).appendChild(SEFront);
        document.getElementById('SEFront' + EventTypes[x].Name).appendChild(SEInner);
        document.getElementById('SEInner' + EventTypes[x].Name).appendChild(EventTypeTitle);
        document.getElementById('SEContainer' + EventTypes[x].Name).appendChild(SEBack);
        document.getElementById('SEBack' + EventTypes[x].Name).appendChild(EventTypeDescription);

        document.getElementById('SEContainer' + EventTypes[x].Name).addEventListener('click',function(){
            window.location = "eventlist.html"
        });
    }

}

window.onload = PopulateEventSearch;

